(198, 8, 'mfn-page-items-seo', '\n<img src=\"http://localhost/atahualpa/wp-content/uploads/2024/11/a-11.jpeg#249\" alt=\"Logo Atahulpa\"/>\ncustom\ncustom\nEstamos cocinando para vos\nEn Atahualpa Burgers elaboramos hamburguesas con ingredientes frescos seleccionados cada día. Todo, desde los panes amasados y horneados a diario, hasta las carnes y vegetales de la mejor calidad,  es hecho a mano para ofrecerte una experiencia gastronómica única. Nuestra pasión por lo artesanal se refleja en cada bocado.\nNuestros Productos\nbutton_theme\n<a href=\"\">{permalink:3}</a>\n<img src=\"http://localhost/atahualpa/wp-content/uploads/2024/11/landing.png#250\" alt=\"landing\"/>\nlazy\n<img src=\"http://localhost/atahualpa/wp-content/uploads/2024/11/logo-2-sin-fondo.png#266\" alt=\"logo 2 sin fondo\"/>\nHamburguesas<br>Recomendas\n<a href=\"http://permalink\">{permalink}</a>\n{title}\n<a href=\"http://permalink\">{permalink}</a>\n{excerpt}\ncenter top no-repeat\n{price}\nMás Hamburguesas\nbutton_theme\n<a href=\"\">{permalink:3}</a>\n¿QUÉ VAS A PEDIR HOY?\n<p style=\"text-align: center;\">Todas las hamburguesas vienen con porción de papas</p>\n\n<p style=\"text-align: center;\">Precios: Simple $4.500 / Doble $5.100 / Triple $5.800</p>\n\npost\ndate\nDESC\ncategory\nID\nASC\nicon-left-open-big\nicon-right-open-big'),
