(1033, 75, 'mfn-page-items-seo', 'THIS HAZY IPA IS BREWED WITH JUICY CITRA AND MOSAIC HOPS, GIVING IT A TROPICAL FRUIT AROMA AND A SLIGHTLY SWEET, REFRESHING TASTE. IT\'S PERFECT FOR A HOT DAY OR A NIGHT OUT WITH FRIENDS.\n#122924\nThe beer pours a hazy golden color with a thick, white head. The aroma is full of juicy citrus fruits, with notes of grapefruit, pineapple, and orange. The taste follows the aroma, with a slightly sweet and refreshing flavor. The beer is well-balanced, with a moderate amount of bitterness and a smooth, creamy finish.\n<table class=\"craftbeer3-customTable\">\n	<tbody>\n		<tr>\n			<td>Bone dry</td>\n			<td>[progress_icons icon=\"fas fa-circle\" count=\"5\" active=\"4\" transparent=\"1\"]	</td>\n			<td>Sweet</td>\n			<td>[progress_icons icon=\"fas fa-circle\" count=\"5\" active=\"5\" transparent=\"1\"]	</td>\n		</tr>\n		<tr>\n			<td>Dry</td>\n			<td>[progress_icons icon=\"fas fa-circle\" count=\"5\" active=\"4\" transparent=\"1\"]	</td>\n			<td>Semi-sweet</td>\n			<td>[progress_icons icon=\"fas fa-circle\" count=\"5\" active=\"5\" transparent=\"1\"]	</td>\n		</tr>\n	</tbody>\n</table>\ncenter top no-repeat\nThe beer pours a hazy golden color with a thick, white head. The aroma is full of juicy citrus fruits, with notes of grapefruit, pineapple, and orange. The taste follows the aroma, with a slightly sweet and refreshing flavor. The beer is well-balanced, with a moderate amount of bitterness and a smooth, creamy finish.\nhttps://themes.muffingroup.com/be/craftbeer3/wp-content/uploads/2024/02/craftbeer3-productdetails-pic1.webp#53'),
